import ProductList from "../parkforestdetail/productList/ProductList";
import { ThemeContext } from "../parkforestdetail/context";
import "../../App.css";

const ParkForestDetail = () => {
  return (
    <div>
      <Intro />
      <About />
      <ProductList />
    </div>
  );
};

export default ParkForestDetail;
